import React from "react";

import "./character.scss";
import Item from "./item/Item";
import data from "./characterData";

//? 人物：npc人物套装
//?
export default function Character() {
  const demoData = [
    {
      suitName: "赵云套",
      suitBuffName: "一身是胆",
      type: "中甲",
      against: "水",
      eName: [
        { eName: "涯角枪" },
        { eName: "豪胆兜鍪" },
        { eName: "豪胆中铠" },
        { eName: "豪胆臂甲" },
        { eName: "豪胆胫甲" },
      ],
      buff: [
        { buffName: "化解的消耗气势", number: -1.8 },
        { buffName: "打倒敌人获得的士气点数", number: 5.0 },
        { buffName: "化解成功时威力上升" },
        { buffName: "枪伤害", number: 8.3 },
      ],
    },
    {
      suitName: "赵云套",
      suitBuffName: "一身是胆",
      type: "中甲",
      against: "水",
      eName: [
        { eName: "涯角枪" },
        { eName: "豪胆兜鍪" },
        { eName: "豪胆中铠" },
        { eName: "豪胆臂甲" },
        { eName: "豪胆胫甲" },
      ],
      buff: [
        { buffName: "化解的消耗气势", number: -1.8 },
        { buffName: "打倒敌人获得的士气点数", number: 5.0 },
        { buffName: "化解成功时威力上升" },
        { buffName: "枪伤害", number: 8.3 },
      ],
    },
  ];
  return (
    <div className="character">
      <h2>25套人物套装总览</h2>
      <div className="displayBox">
        <div>
          <span>人物</span>
          <span>类型</span>
          <span>抗性</span>
          <span>套装效果名称</span>
          <span>套装</span>
          <span>加成效果</span>
        </div>

        {demoData.map((ele) => {
          return <Item key={ele.suitName} data={ele} />;
        })}
      </div>
    </div>
  );
}
